import React, { Component } from 'react'
import UserService from './../../../service/user.service'

import './UserList.css'

class UserList extends Component {
    constructor() {
        super()
        this.state = {
            users: []
        }
    }

    getAllUsers = () => {
        this.userService.getUsers()
            .then(response => console.log(response))
    }

    componentDidMount = () => {
        this.getAllUsers()
    }
    render
}
export default UserList
